import { useSelector } from "react-redux";

const Cart = () => {

  const {cart} = useSelector((state) => state)
  return (
    <div>
    {
      cart.length > 0 ?
      (
        <div>
          {
            cart.map((item, index) => {
                return <CartItem key={item.id} item={item} />
            })
          }
        </div>
      ) :
      (
        <div>
          <h1>Cart is Empty</h1>

          <Link to="/">
            <button>Shop Now</button>
          </Link>
        </div>
      )
    }
    </div>
  );
};

export default Cart;
